  `finish_ts` bigint(0) NOT NULL COMMENT '任务结束时间',
  `created_at` datetime(0) NOT NULL COMMENT '创建时间',
  `updated_at` datetime(0) NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `task`(`task_type`) USING BTREE,
  INDEX `user`(`user_id`, `status`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 100101049 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = '任务发布表' ROW_FORMAT = Dynamic;

